import React, { Component } from 'react';

class Practice extends Component {
    state = {  }
    render() { 
        const MyInfo = [
            {
                Fname:'Habibullah',
                Lname:'Tonoy',
                age:24,
                Gender:'male'
            },
            {
                Fname:'Habib',
                Lname:'Tonoy',
                age:24,
                Gender:'male' 
            }
        ]
        return ( 
            <div className="tag">
                {MyInfo.map(function(info) {
                    return <div>My Name:{info.Fname} </div>;
                })}
            </div>
         );
    }
}

export default Practice;
